import React from "react";

class Memo extends React.Component {
    render() {
        return (
            <div className="memo">
                <div className="memo-title">{this.props.title}</div>
                <div className="memo-date">
                    {this.props.date}</div>
            </div>
        )
    }
}

export default Memo
